import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

const list = [
  {
    title: 'React',
    url: 'https://reactjs.org/',
    author: 'Jordan Walke',
    num_comments: 3,
    points: 4,
    objectID: 0,
  },
]

class App extends Component {
  render() {
    const helloWorld = 'Welcome to the Road to Learn React'
    const user = {
      first: 'Reid',
      last: 'Garner'
    }
    return (
      <div className="App">
        <h2>{helloWorld}</h2>
        <h2>{user.first}</h2>
        <h2>{user.last}</h2>
      </div>
    );
  }
}

export default App;
